text:
@akasmittie Hello, 
Thank you for reaching out in regard to Beta DNA match Group. 
We do not have a specific team for Beta but we are more than happy to answer any questions through Ancestry support. You can also leave feedback In the bottom right-hand corner of the new matches page.

@MimiGlossop Hello Melissa, 

Thrulines ancestors is based on your AncestryDNA matches. You do have the ability to not add them to your tree should you choose not to. 
Thank you for the opportunity to assist you.

@YRachmania Hello yasmine, 

Thank you for reaching out in regard to shipping an AncestryDNA kit. 

An AncestryDNA kit currently cannot be purchased in one country and shipped to another. The shipping address and billing address must both be in the same country.

@re_to_jennifer Hello Jennifer, 
Thank you for reaching out to us in regard to your AncestryDNA matches.
When you click on a match, you’ll see three filter options in the center of the page. This can help you narrow down which side of your family various matches are from.

@tmb_aqui Hello TB, 
Thank you for reaching out to us in regard to you AncestryDNA kit.
We might best serve you by speaking to you over the phone. Please contact us to speak with one of our associates between the hours 7am and 9pm MST at 1-800-262-3787. We look forward to hearing from you.

@alinobby It is important to note that Shared Ancestor Hints and DNA Circles rely heavily on the tree data and a number of criteria are necessary in order for both to form. These articles will advise further on each. 1/2

https://t.co/5LKm4557FS
https://t.co/mifZGcjhSF

@Dontpunkme Hi there! We are sorry for the delay in responding to your query. We are happy to clarify how we we determine the range for your DNA regions. The article linked will advise further on this.

https://t.co/vaPWqK3Wls

We hope this helps clarify this for you!

@lewellyn Hello Matt, 

We don't typically call out unless it has been arranged in advance. 

If you are needing to speak with one of our customer service representatives you can contact us between the hours of 7am and 9pm MST at 1-800-262-3787.

@scottjung Hello Scott! Thank you for the opportunity to address your concerns! We would like to provide you a couple of articles on AncestryDNA, so that you may compare their tactics to ours. Thank you! 

https://t.co/IP2mgOXedN

https://t.co/KGwQqCqgj6

@RomanosBooks Hello, John. Unfortunately, we are unable to help answer questions regarding https://t.co/Ik6hwrj2Ov however, we were able to successfully locate their Twitter handle @_newspapers
Try to use that handle as it should work.

We hope this helps!

@cole_beans Ancestry privacy policy states that you will always maintain ownership of your DNA and DNA data which you can manage or request deletion at any time.

We provide a complete breakdown of our privacy statement that you may access here: https://t.co/QfLxvZjwwP

We hope this helps!

@ediefrizol Hello Edie. We are so excited to hear about your amazing experience and glad we could be apart of it. We would like to invite you to share your success story here:
https://t.co/oNt6dsQuEE
Thank you!

@yalingliou Hello, Thank you for your inquiry regarding names on your family tree.  Attached below is an article that is most relevant and helpful to your question. 

Thank you for reaching out to us. We appreciate the opportunity to assist you. 

https://t.co/VPaxp1FMRB

@kk_cole Hi again Kim, we would like for you to call or email us to further look into your account and track your DNA status. Please call us at 1-800-262-3787
M-Su 7am <U+0096> 9pm MST* or 
email us at ancestrysupport@ancestry.com. Thank you.

@ShadoSolo Hello, 

Thank you so much for reaching out to us.
Ancestry is the world’s largest online resource for family history research and DNA matching with a DNA database of over 10 million people.

@EastCauthor Hello there! We are delighted to hear that you're researching your family with us. We us the latest science and technology to enable discoveries that are uniquely relevant to you. Please see the following links.

 https://t.co/EWQXO9iQeN

https://t.co/iR1uBaMVsB

@AlanBryan7 @KellyRipa We want to clarify that we take DNA privacy very seriously. We recommend reading the articles we have below so you have the most accurate information. We want to stress that every Ancestry member retains ownership of their DNA.

https://t.co/XoKBFardiq
https://t.co/VKU8Y3zZT3

@Alexiss127 Please note that once the kit is activated on an account and the results are posted  to the account, he could then have his results shared over to your account if you would like to manage his results. The article below discusses this:

https://t.co/sLuxB9NquW

We hope this helps!

@foremanwrites We are sorry for the delay in our response. We are happy to assist you. We have included an article below which will provide some guidance on how you can apply the gift subscription to your account:

https://t.co/9UDXjyQwx5

Please let us know if you have any issues with this.

@technologypoet @thogge @23andMe Our Chief Privacy Officer released a blog post that you may be interested in. We have included a link for it here: 

https://t.co/z46qw80YR6 

We very clearly state that AncestryDNA does not “claim ownership rights in the DNA that is submitted for testing.” 1/2

@CaramelMacc4 Hi @CaramelMacc4. We wish you the best of luck on your journey and hope you experience much success! We have included links below that can help you in making the most of your results. Let us know if we can help with anything. :)

https://t.co/lTgnhEj4C4

https://t.co/6gNoeW2eOc

@squeezeitintyp Hello, @squeezeitintyp.  Thank you for your concerns about the privacy of our DNA test. The links below explain AncestryDNA privacy in detail. 

https://t.co/yUfjGSADNW

https://t.co/cuyux86eTU

@StephandStuff5 @TheSciBabe Your DNA data belongs to you. It will never be sold or provided to insurers, employers or third-party marketers. We recommend reading our Privacy Statement which we have linked.  
"You always maintain ownership of your DNA and DNA Data" is quoted directly.
https://t.co/4XM1CqjKbQ

@rabbitholer @TheSciBabe We would just like to clarify that your DNA data belongs to you. It will never be sold or provided to insurers, employers or third-party marketers. You can find more information in our privacy center: 

https://t.co/LmBmgK1cQJ

We hope this helps clarify!

@paulpuckett911 Hi Clarence! We think you are likely confusing us with Family Search. Ancestry is not owned by The Church of Jesus Christ of Latter-day Saints. Any further information on Ancestry can be found using the link we have included below:

https://t.co/g1okAok3yW

We hope this helps!

@VKVJ13 We would recommend reading our Privacy Statement as to be able to provide the most accurate information. "You always maintain ownership of your DNA and DNA Data" quoted directly out of the Privacy Statement found below: 

https://t.co/EblbJPHAgr

We hope this clarifies!

@karenbar13 Hi, Karen! Due to the nature of the situation we feel it best to call in to our support line to investigate and correct the situation. 
M-Su 7am – 9pm MST*
1-800-262-3787

@lefty_juggler Hi Dan. Have you met the requirements for Circles? The linked article has the 4 requirements for DNA Circles to appear. Please let us know if you have additional
questions that we can help with by sending a direct message.

https://t.co/BF7uMoFeNA

@jagallow Hi there. It is important to know that not everyone will get DNA Circles automatically, once they get the DNA results. There are specific criteria which must be met. The below article will advise further on how they work:

https://t.co/scNH29i89o

We hope this helps!
